import Hero from "./hero";
const About = () => {
  return (
    <>
      <Hero text="About Us!" />
      <div className="container">
        <div className="row">
          <div className="col-lg-8 offset-lg-2 my-5">
            <p className="lead">
              Adipisicing commodo labore ad et cupidatat amet qui ea
              reprehenderit do. Id irure ad et aliquip dolore id sunt sit. Velit
              sit do proident est do dolor ullamco magna quis. Laboris commodo
              adipisicing est ex quis reprehenderit sint labore duis. Nostrud
              nisi quis ullamco fugiat sint adipisicing labore cillum non.
            </p>
          </div>
        </div>
      </div>
    </>
  );
};
export default About;
